import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './pages/Home';
import NavbarComp from './components/NavbarComp';

class App extends Component {

    render() {
        return (
        <div>
            <NavbarComp/>
            <Home/>
        </div>
        
        )
        
    }
}


export default App;
